// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import ProductCard from './components/ProductCard';
import CartPage from './components/CartPage';

const App = () => {
    const products = [
        { id: 1, name: 'Product 1', price: 100, image: 'https://via.placeholder.com/150' },
        { id: 2, name: 'Product 2', price: 200, image: 'https://via.placeholder.com/150' },
        { id: 3, name: 'Product 3', price: 300, image: 'https://via.placeholder.com/150' },
    ];

    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={<div className="product-list">{products.map(product => <ProductCard key={product.id} product={product} />)}</div>} />
                <Route path="/cart" element={<CartPage />} />
            </Routes>
        </Router>
    );
};

export default App;
